import React from "react";

function DriveVideoEmbed() {
    const videoUrl = "https://drive.google.com/file/d/1MF9pskvYNstpLSs_vHGEpdLKcZDiAxYS/preview";

    return (
        <div style={{ width: "100%", maxWidth: "800px", margin: "0 auto" }}>
            <iframe
                src={videoUrl}
                width="100%"
                height="480"
                allow="autoplay"
                title="Google Drive Video"
                style={{ border: "none" }}
            ></iframe>
        </div>
    );
}

export default DriveVideoEmbed;
